import React from 'react';

const Logo = () => {
  return (
    <div className="logo">
      <div className="logo-dots">
        {[...Array(9)].map((_, i) => (
          <div key={i} className="dot" style={{ animationDelay: `${i * 0.1}s` }} />
        ))}
      </div>
      <div className="logo-text">
        <span className="company-name">Radiance</span>
        <span className="company-type">Technologies</span>
      </div>
    </div>
  );
};

export default Logo;
